import styled from "@emotion/styled";
import SpecialCard from "./SpecialCard";
import BigCard from "./BigCard";

import LeftMenu from "./LeftMenu";
import RightSection from "./RightSection";
import { PupilStatT } from "../typesTS/PupilStatT";
// import SearchBar from "./SearchBar";
// import styled from "@emotion/styled/macro";

export default function MainPage() {
  // styles
  const CardsSection = styled.div`
    display: grid;
    margin-top: 15px;
    grid-template-columns: 278px 278px 278px;
    grid-template-rows: auto auto;
    grid-gap: 18.5px;
    margin-left: 31px;
  `;
  const BigElement = styled.div`
    grid-column-start: 1;
    grid-column-end: 2;
    grid-row-start: 1;
    grid-row-end: 3;
  `;
  const CardOne = styled.div`
    grid-column-start: 2;
    grid-column-end: 3;
    grid-row-start: 1;
    grid-row-end: 2;
  `;
  const CardTwo = styled.div`
    grid-column-start: 3;
    grid-column-end: 4;
    grid-row-start: 1;
    grid-row-end: 2;
  `;
  const CardThree = styled.div`
    grid-column-start: 4;
    grid-column-end: 5;
    grid-row-start: 1;
    grid-row-end: 2;
  `;
  const CardFour = styled.div`
    grid-column-start: 2;
    grid-column-end: 3;
    grid-row-start: 2;
    grid-row-end: 3;
  `;
  const CardFive = styled.div`
    grid-column-start: 3;
    grid-column-end: 4;
    grid-row-start: 2;
    grid-row-end: 3;
  `;
  const CardSix = styled.div`
    grid-column-start: 4;
    grid-column-end: 5;
    grid-row-start: 2;
    grid-row-end: 3;
  `;
  // state
  const [pupilStatElem] = useState<PupilStatT>({
    quantity: 250,
    lastWeek: 25,
    withoutAbo: 150,
    inactive: 25,
    dayAdded: 50,
    picAdress: "/bigCardPic.png",
  });
  return (
    <CardsSection>
      <BigElement>
        <BigCard pupilStatElem={pupilStatElem}></BigCard>
      </BigElement>
      <CardOne>
        <SmallCard card={cardContent[0]}></SmallCard>
      </CardOne>
      <CardTwo>
        <SmallCard card={cardContent[1]}></SmallCard>
      </CardTwo>
      <CardThree>
        <SmallCard card={cardContent[2]}></SmallCard>
      </CardThree>
      <CardFour>
        <SmallCard card={cardContent[3]}></SmallCard>
      </CardFour>
      <CardFive>
        <SmallCard card={cardContent[4]}></SmallCard>
      </CardFive>
      <CardSix>
        <SpecialCard card={cardContent[5]}></SpecialCard>
      </CardSix>
    </CardsSection>
  );
}
